import React from 'react'
import ReactDom from 'react-dom'
import App from './app'

const IMAGE_DATA = [
    {
      src: './images/agv.jpg',
      alt: 'images-1',
    },
    {
      src: require('./images/robot1.jpg'),
      alt: 'images-2',
    },
    {
      src: require('./images/robot2.jpg'),
      alt: 'images-3',
    },
];

ReactDom.render(
    <App 
        items={IMAGE_DATA}
        speed={1.2}
        delay={2.1}
        pause={true}
        autoplay={true}
        dots={true}
        arrows={true}
    />,
    document.getElementById('root')
)
